      <ul>
        <li><a onMouseEnter={() => setishover(true)} onMouseLeave={() => setishover(false)} className={ishover ? 'bg-active' : 'bg'} href="#member">Member</a></li>
        <li><a href="#story">Story</a></li>
        <li><a href="#moral">Moral</a></li>

      </ul>

    </div>
  )
}















